angeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"In this quick video from my Machine Learning Foundations series, I address special types of vectors (basis, orthogonal, and orthonormal), which are critical for machine learning applications. We’ll also  do a hands-on code exercise to mathematically demonstrate orthogonal vectors in NumPy. \n\nThere are eight subjects covered comprehensively in the ML Foundations series and this video is from the first subject, \"Intro to Linear Algebra\". More detail about the series and all of the associated open-source code is available at github.com/jonkrohn/ML-foundations\n\nThe next video in the series is:    • Matrix Tensors — Topic 8 of Machine Learni...  \n\nThe playlist for the entire series is here:    • Linear Algebra for Machine Learning  \n\nThis course is a distillation of my decade-long experience working as a machine learning and deep learning scientist, including lecturing at New York University and Columbia University, and offering my deep learning curriculum at the New York City Data Science Academy. Information about my other courses and content is at jonkrohn.com\n\nDr. Jon Krohn is Chief Data Scientist at untapt, and the #1 Bestselling author of Deep Learning Illustrated, an interactive introduction to artificial neural networks. To keep up with the latest from Jon, sign up for his newsletter at jonkrohn.com, follow him on Twitter @JonKrohnLearns, and on LinkedIn at linkedin.com/in/jonkrohn","commandRuns":[{"startIndex":597,"length":52,"onTap":{"innertubeCommand":{"clickTrackingParams":"CIAFEM2rARgBIhMI6fvIo6_MkAMViaVWAR2G5wmkygEEhm1SUw==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=NEp9uDJZ3gY","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"NEp9uDJZ3gY","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig" ra\". More detail about the series and all of the associated open-source code is available at github.com/jonkrohn/ML-foundations\n\nThe next video in the series is:    • Matrix Tensors — Topic 8 of Machine Learni...  \n\nThe playlist for the entire series is here:    • Linear Algebra for Machine Learning  \n\nThis course is a distillation of my decade-long experience working as a machine learning and deep learning scientist, including lecturing at New York University and Columbia University, and offering my deep learning curriculum at the New York City Data Science Academy. Information about my other courses and content is at jonkrohn.com\n\nDr. Jon Krohn is Chief Data Scientist at untapt, and the #1 Bestselling author of Deep Learning Illustrated, an interactive introduction to artificial neural networks. To keep up with the latest from Jon, sign up for his newsletter at jonkrohn.com, follow him on Twitter @JonKrohnLearns, and on LinkedIn at linkedin.com/in/jonkrohn","commandRuns":[{"startIndex":597,"length":52,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB0Q040EGAUiEwjp-8ijr8yQAxWJpVYBHYbnCaTKAQSGbVJT","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=NEp9uDJZ3gY","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"NEp9uDJZ3gY","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-1xvoxu-qxas.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026siu=1\u0026msp=1\u0026odepv=1\u0026id=344a7db83259de06\u0026ip=103.110.16.122\u0026initcwndbps=1428750\u0026mt=1761842243\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTYzNDI4MQ\u0026rxtags=Cg4KAnR4Egg1MTYzMTI2NA%2CCg4KAnR4Egg1MTYzNDI0OQ%2CCg4KAnR4Egg1MTYzNDI1MA%2CCg4KAnR4Egg1MTYzNDI3OA%2CCg4KAnR4Egg1MTYzNDI3OQ%2CCg4KAnR4Egg1MTYzNDI4MA%2CCg4KAnR4Egg1MTYzNDI4MQ"}}}}}},"onTapOptions":{"acces
